@iiDudes จะเปิดไลน์ผลิตในอีก 2 ปี ส่วนไทยน่ะเหรอ หึหึ เดือนหน้าเริ่มส่งมอบวัคซีนแล้ว ขำๆ เนอะ 

กว่าสิงคโปร์ จะเริ่มผลิต วัคซีนโควิดน่าจะเกลื่อนแล้วล่ะ 

ตรรกะที่บิดเบี้ยวจริงๆ

@scorpiovibesaf มีงานจำนวนมากขึ้นเป็นภูเขา 
แถมต้องสแกนความปลอดภัยจากโควิด เช่น พื้นที่ เสี่ยงสูง เขามีการฉีดพ่นฆ่าเขื้อ หรือ ผ่านยูวี ด้วยครับ 
น่าสงสาร ไรเดอร์ทีมต่างๆ  พวกเขาก็กลัว เขาสัมผัสของมากมายแต่ละวัน โดยไม่รู้เลยว่า คนส่งหรือคนรับ มีเชื้อไวรัสหรือไม่  ดูแลกันและกัน นะครับ
